import React from 'react';

function Doc(props) {

  return (
    <div className="docs_col">
      <img src={URL.createObjectURL(props.source)} className="image" alt="doc not uploaded"/>
      <p>{props.source.name}</p>
    </div>
  );
};

export default Doc;
